package eu.angel.bleembedded.lib.beacon.msg;

import org.altbeacon.beacon.Beacon;
import org.altbeacon.beacon.BeaconManager;
import org.altbeacon.beacon.BeaconParser;

/**
 * Created by giova on 24/01/2017.
 */

public class BeaconMsgNearable extends BeaconMsgBase {

    public static String MSG_LAYOUT = "m:0-1=5d01,i:2-11,d:12-12,d:13-13,d:14-15,d:16-16,d:17-17,d:18-18,d:19-19,d:20-20,p:21-21";
    public static String MSG_TYPECODE = "5d01";

    public double mTemperature=-1;
    public double[] mAcceleration;

    public BeaconMsgNearable(Beacon b) {
        super(b);
    }

    @Override
    public BeaconMsgBase parse() {
        if (!this.MSG_TYPECODE.toUpperCase().equals(Long.toHexString(this.getBeaconTypeCode()).toUpperCase())) {
            return null;
        }
        // Note: Here you can put your code to parse message data fields into convenient instance class variables

        // NOTE: how to parse message taken from:
        // https://github.com/sandeepmistry/node-bleacon/blob/master/estimote-sticker/estimote-sticker.js#L53

        long rawTemperature  = (Long.reverseBytes(this.getDataFields().get(1))& 0x0fff) << 4;

        if (rawTemperature >= 0x8000) {
            mTemperature = ((rawTemperature & 0x7fff) - 32768.0) / 256.0;
        } else {
            mTemperature = rawTemperature / 256.0;
        }

        mAcceleration = new double[] {
                this.getDataFields().get(3)* 15.625,
                this.getDataFields().get(4)* 15.625,
                this.getDataFields().get(5)* 15.625
        };

        return this;
    }

    public String toString() {
        return String.format("%s,\nEXTRA:temp:%s,\nax:%s,\nay:%s,\naz:%s",super.toString(),mTemperature,mAcceleration[0],mAcceleration[1],mAcceleration[2]);
    }

    @Override
    public String getImage() {
        return BASE64_IMAGE;
    }


    private static String BASE64_IMAGE = "";
}
